INSERT INTO `ae_posts` VALUES (3,1,'2018-08-28 12:20:55','2018-08-28 18:20:55','<h2>Who we are</h2><p>Our website address is: http://localhost:8888/alto-empleo.</p><h2>What personal data we collect and why we collect it</h2><h3>Comentarios</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Medios</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>','Privacy Policy','','trash','closed','open','','privacy-policy__trashed','','','2018-09-27 10:39:29','2018-09-27 15:39:29','',0,'http://localhost:8888/alto-empleo/?page_id=3',0,'page','',0),(56,1,'2018-08-31 10:04:13','2018-08-31 15:04:13','','Nombre de prueba','','publish','closed','closed','','nombre-de-prueba','','','2018-09-19 10:10:50','2018-09-19 15:10:50','',0,'http://localhost:8888/alto-empleo/?post_type=ae_candidatos&#038;p=56',0,'ae_candidatos','',0),(75,1,'2018-08-31 16:53:39','2018-08-31 22:53:39','<p class=\"nameEmpleado\">Nombre apellido</p><pre lang=\"php\"></pre><p class=\"nameEmpleado\">Nombre apellido</p>','Nombre apellido','','inherit','closed','closed','','56-autosave-v1','','','2018-08-31 16:53:39','2018-08-31 22:53:39','',56,'http://localhost:8888/alto-empleo/2018/08/31/56-autosave-v1/',0,'revision','',0),(87,1,'2018-01-03 09:52:31','2018-01-03 14:52:31','','Prueba Empleado apellido 1','','trash','closed','closed','','autorizacion__trashed','','','2018-10-17 13:30:50','2018-10-17 18:30:50','',0,'http://localhost:8888/alto-empleo/?post_type=ae_cartas&#038;p=87',0,'ae_cartas','',0),(88,1,'2018-09-03 12:24:40','2018-09-03 18:24:40','','altoempleo_logo','','inherit','open','closed','','altoempleo_logo','','','2018-09-03 12:24:40','2018-09-03 18:24:40','',87,'http://localhost:8888/alto-empleo/wp-content/uploads/2018/09/altoempleo_logo.png',0,'attachment','image/png',0),(96,1,'2018-09-04 09:22:03','2018-09-04 15:22:03','','Nombre del empleado','','publish','closed','closed','','titulo','','','2018-09-26 12:53:42','2018-09-26 17:53:42','',0,'http://localhost:8888/alto-empleo/?post_type=wbcr-snippets&#038;p=96',0,'wbcr-snippets','',0),(97,1,'2018-09-04 09:58:17','2018-09-04 15:58:17','','Fecha de ingreso empleado','','publish','closed','closed','','fecha-de-ingreso-empleado','','','2018-09-26 13:19:16','2018-09-26 18:19:16','',0,'http://localh