trong>por conducto de [wbcr_php_snippet id=\"100\" title=\"Persona Sr. o Srita.\"]<strong> [wbcr_php_snippet id=\"96\" title=\"Nombre del empleado\"]</strong><strong>  </strong>quien se encuentra bajo nuestra dirección, supervisión y dependencia y cuyos datos a continuación se  detallan:\r\n<p style=\"text-align: center;\">NUMERO DE SEGURIDAD SOCIAL DEL I.M.S.S.  <strong>[wbcr_php_snippet id=\"98\" title=\"Número de Seguro Social\"]</strong></p>\r\n<p style=\"text-align: center;\">REGISTRÓ FEDERAL DE CONTRIBUYENTES: <strong>[wbcr_php_snippet id=\"99\" title=\"RFC\"]</strong></p>\r\n<p style=\"text-align: center;\">NOMBRE DEL SUPERVISOR: PILAR LOPEZ GARCIA</p>\r\nSE ANEXA COPIA DE VIGENCIA DE DERECHOS DEL IMSS Y COPIA DE IDENTIFICACION OFICIAL\r\n\r\nAhora bien debido a  que tanto mi representada como NUEVA WALMART DE MEXICO DE S.R.L DE CV. En adelante WAL*MART son partes contratantes totalmente independientes que sólo tienen negocios de carácter mercantil y que no existe ningún nexo o relación obrero-patronal entre ambas, seremos responsables del pago del sueldos salarios, cuotas al SAR, IMSS,  INFONAVIT y demás impuestos , derechos y obligaciones que se causen con el motivo del desarrollo de las actividades de la persona indicada.\r\n\r\nDerivado de lo anterior se entenderá que bajo ningún tipo de circunstancias WALMART podrá ser considerada como responsable por lo antes descrito. Obligándose a EL PROVEEDOR a notificar a WALMART de forma inmediata de cualquier juicio o reclamación de carácter laboral, individual o colectivo, que  intente el personal o los ex empleados de EL PROVEEDOR en su contra o en contra de WALMART obligándose a EL PROVEEDOR sacar a paz y salvo a WALMART dentro de un plazo que no excederá de sesenta días naturales a  partir de la fecha en que se tenga conocimiento de tales juicios o reclamaciones.\r\n\r\nAsi mismo, nos permitimos confirmarles que  la persona de que se trata, se desempeñara conforme al horario y al Reglamento Interno de trabajo establecido en su unidad comercial con el objeto de  que no altere la disciplina de la misma.\r\n\r\nSin otro particular por el momento y agradeciendo de antemano la atención que se sirvan dispensar al contenido de la presente, quedamos de ustedes.','Wallmart','','trash','closed','closed','','wallmart__trashed','','','2018-10-17 13:30:50','2018-10-17 18:30:50','',0,'http://localhost:8888/alto-empleo/?post_type=ae_cartas&#038;p=195',0,'ae_cartas','',0),(197,1,'2018-09-04 15:17:26','2018-09-04 21:17:26','','Inicio','','publish','closed','closed','','inicio','','','2018-09-07 13:32:36','2018-09-07 18:32:36','',0,'http://localhost:8888/alto-empleo/?p=197',1,'nav_menu_item','',0),(206,1,'2018-09-04 15:59:08','2018-09-04 21:59:08','','Quiénes somos','','publish','closed','closed','','quienes-somos','','','2018-09-07 13:32:36','2018-09-07 18:32:36','',0,'http://localhost:8888/alto-empleo/?p=206',2,'nav_menu_item','',0),(207,1,'2018-09-04 15:59:08','2018-09-04 21:59:08','','Servicios','','publish','closed','closed','','servicios','','','2018-09-07 13:32:36','2018-09-07 18:32:36','',0,'http://localhost:8888/alto-empleo/?p=207',3,'nav_menu_item','',0),(208,1,'2018-09-04 15:59:08','2018-09-04 21:59:08','','Contacto','','publish','closed','closed','','contacto','','','2018-09-07 13:32:37','2018-09-07 18:32:37','',0,'http://localhost:8888/alto-empleo/?p=208',4,'nav_menu_item','',0),(209,1,'2018-09-04 15:59:08','2018-09-04 21:59:08','','Registro','','publish','closed','closed','','registro','','','2018-09-07 13:32:37','2018-09-07 18:32:37','',0,'http://localhost:8888/alto-empleo/?p=209',5,'nav_menu_item','',0),(211,1,'2018-10-24 17:09:32','2018-10-24 22:09:32','[[[{\"field_key\":\"user_login\",\"general_setting\":{\"label\":\"Usuario\",\"description\":\"\",\"field_name\":\"user_login\",\"placeholder\":\"\",\"required\":\"yes\",\"hide_label\":\"no\"},\"advance_setting\":{}},{\"field_key\":\"user_pass\",\"general_setting\":{\"label\":\"Contraseña\",\"description\":\"\",\"field_name