losed','','233-revision-v1','','','2018-09-27 10:38:51','2018-09-27 15:38:51','',233,'http://localhost:8888/alto-empleo/233-revision-v1/',0,'revision','',0),(373,1,'2018-09-27 10:38:51','2018-09-27 15:38:51','Please select a gateway for payment','Payment','','inherit','closed','closed','','231-revision-v1','','','2018-09-27 10:38:51','2018-09-27 15:38:51','',231,'http://localhost:8888/alto-empleo/231-revision-v1/',0,'revision','',0),(374,1,'2018-09-27 10:38:52','2018-09-27 15:38:52','[wpuf_sub_pack]','Subscription','','inherit','closed','closed','','230-revision-v1','','','2018-09-27 10:38:52','2018-09-27 15:38:52','',230,'http://localhost:8888/alto-empleo/230-revision-v1/',0,'revision','',0),(375,1,'2018-09-27 10:38:52','2018-09-27 15:38:52','<h1>Payment is complete</h1><p>Congratulations, your payment has been completed!</p>','Thank You','','inherit','closed','closed','','232-revision-v1','','','2018-09-27 10:38:52','2018-09-27 15:38:52','',232,'http://localhost:8888/alto-empleo/232-revision-v1/',0,'revision','',0),(376,1,'2018-09-27 10:39:29','2018-09-27 15:39:29','<h2>Who we are</h2><p>Our website address is: http://localhost:8888/alto-empleo.</p><h2>What personal data we collect and why we collect it</h2><h3>Comentarios</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Medios</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>','Privacy Policy','','inherit','closed','closed','','3-revision-v1','','','2018-09-27 10:39:29','2018-09-27 15:39:29','',3,'http://localhost:8888/alto-empleo/3-revision-v1/',0,'revision','',0),(377,1,'2018-09-27 11:00:40','2018-09-27 16:00:40','','Nayeli Jordán','','trash','closed','closed','','altoempleo_admin__trashed-8','','','2018-09-28 12:07:38','2018-09-28 17:07:38','',0,'http://localhost:8888/alto-empleo/ae_perfil/altoempleo_admin/',0,'ae_perfil','',0),(378,1,'2018-09-27 12:41:30','2018-09-27 17:41:30','','Prueba','','trash','closed','closed','','prueba__trashed','','','2018-10-25 12:08:33','2018-10-25 17:08:33','',0,'http://localhost:8888/alto-empleo/prueba/',0,'page','',0),(379,1,'2018-09-27 12:54:18','2018-09-27 17:54:18','<div id=\"vacanteName\" class=\"col s12\">\r\n	<label>[text* postulacion-vacante]</label> \r\n</div>\r\n<div class=\"col s12 m4\">\r\n	<label>